import React, {Component} from 'react';

import Micon from '../Misc/images/movieicon.png'

class MovieSearch extends Component {
render() {
return(
	<div class="nav-container">			
  		<div class="row">
    		<div class="col-sm">
      			<img alt="nav icon" drc={Micon}/>
    		</div>
    		<div class="col-sm">
      			One of three columns
    		</div>
  		</div>
	</div>
		)
	}
}

export default MovieSearch;
